INSERT INTO routes (routeName, grade, safety, sport, trad, toprope, boulder, snow, alpine, firstAscent, description, location, areaLongitude, areaLatitude, areaName) VALUES ('Ain''t Misbehavin', '5.8+', NULL, true, false, false, false, false, false, 'Unknown', 'Follow the leftmost bolt line on the left wall of White Cliff. 6 bolts lead to a 2-bolt anchor  This is another great line with a cruxy start and a mellow finish. If you traverse left (then back right) after the first bolt, it goes at 7+ with a pendy fall if you don''t stick it.', 'This is the leftmost route on the west (left) White Cliff wall.', -106.1227, 39.5679, 'White Cliff');
